package project.test.intw;

public class FindTheDifference {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		FindTheDifference ftd = new FindTheDifference();
		String string1="";
		String string2="";
		
		System.out.println(ftd.findTheDifference(string1, string2));
	}

	public char findTheDifference(String s, String t) {
		char ch = ' ';
		int size = 0;
		if (s.length() > t.length()) {
			size = s.length();
		} else if (s.length() < t.length()) {
			size = t.length();
		} else {
			size = s.length();
		}
		if(size>1) {
		for (int i = size-1;i>0;i--) {
			if (s.length()>t.length()) {
				if (!(s.charAt(i)==0)) {
					ch = s.charAt(i);
					break;
				}
			} else if(s.length()<t.length()) {
				if (!(t.charAt(i)==0)) {
					ch = t.charAt(i);
					break;
				}
			}else if(s.length()==t.length()) {
				ch=t.charAt(i);
			}
			break;
		}
		} else {
			ch=t.charAt(0);
		}

		return ch;

	}

}
